public class seperatorMatrix {

    public static int seperatorMatrix(boolean a, boolean b, boolean c) {
    int i = 0;
    if (a)
        i = i + 100;
    if (b)
        i = i + 10;
    if (c)
        i = i + 1;
    if (i == 111)
        return 11;
    if ((i == 110) || (i == 101))
        return 10;
    if (i == 11)
        return 1;
    if ((i == 100) || (i == 10) || (i == 1) || (i == 0))
        return 0;
    return 11;
}

